import React from "react";
import { useOutletContext } from "react-router";

const Posts = () => {
    const [itemSell, useItemSell] = useOutletContext();
    return (
        itemSell.map((indivPost, idx) => {
            console.log(indivPost)
            return (
                <div key={idx}>
                    <p>Post Author: {indivPost.author.username}</p>
                </div>
            )
        })

    )
}

export default Posts;
